  sort(sort: { key: string; value: string }): void {
    this.sortName = sort.key;
    this.sortValue = sort.value;
    this.search();
  }

  search(): void {
    if (!this.sortValue) {
      this.listOfDisplayData = this.listOfAllData;
      return;
    }
    this.listOfDisplayData = this.listOfDisplayData.sort(
      (a: Transfer, b: Transfer) => {
        const check =
          this.sortValue === "ascend"
            ? a[this.sortName] <= b[this.sortName]
            : a[this.sortName] >= b[this.sortName];
        return check ? 1 : -1;
      }
    );
  }

  currentPageDataChange($event: Transfer[]): void {
    this.listOfDisplayData = $event;
    this.refreshStatus();
  }

  refreshStatus(): void {
    this.isAllDisplayDataChecked = this.listOfDisplayData
      .filter(item => item.id)
      .every(item => this.mapOfCheckedId[item.nrCnpjCpfFavorecido]);
    this.isIndeterminate =
      this.listOfDisplayData
        .filter(item => item.id)
        .some(item => this.mapOfCheckedId[item.nrCnpjCpfFavorecido]) &&
      !this.isAllDisplayDataChecked;
    this.numberOfChecked = this.listOfAllData.filter(
      item => this.mapOfCheckedId[item.nrCnpjCpfFavorecido]
    ).length;
  }

  checkAll(value: boolean): void {
    this.listOfDisplayData
      .filter(item => item.id)
      .forEach(item => (this.mapOfCheckedId[item.nrCnpjCpfFavorecido] = value));
    this.refreshStatus();
  }

  verifyCanCheck(event, value) {
    if (!event) {
      delete this.mapOfCheckedId[value.cpf];
    } else {
      this.mapOfCheckedId[value.cpf] = value;
    }
  }

  searchByField(event) {
    const match = event.target.value.toLowerCase();

    if (!match || match == "") this.listOfDisplayData = this.listOfAllData; // limpa filtro

    this.listOfDisplayData = this.listOfAllData.filter(
      data =>
        data.nomeFavorecido.toLowerCase().indexOf(match) >= 0 ||
        new Date(data.dataTransferencia)
          .toLocaleString()
          .split(" ")[0]
          .indexOf(match) >= 0 ||
        data.valorTransferencia.toString().indexOf(match) >= 0 ||
        data.situacaoTransferencia.toLowerCase().indexOf(match) >= 0
    );
  }
