  modalData = null;

  getIconProgress(icon, state) {
    const states = ["PENDENTE", "PROCESSANDO", "CONCLUIDO", "RECUSADO"];
    if (icon == "PROCESSANDO" && state == "RECUSADO") return "error";
    if (icon == "CONCLUIDO" && state == "RECUSADO") return "wait";
    if (icon == state) return "process";
    if (states.indexOf(icon) < states.indexOf(state)) return "finish";
    else return "wait";
  }

  maskCpfCnpj(text: string) {
    if (text.length <= 11)
      return text.replace(/(\d{3})(\d{3})(\d{3})(\d{2})/g, "$1.$2.$3-$4");
    else
      return text.replace(
        /(\d{2})(\d{3})(\d{3})(\d{4})(\d{2})/g,
        "$1.$2.$3/$4-$5"
      );
  }

  toCurrency(value: number) {
    return value
      .toFixed(2)
      .toString()
      .replace(".", ",")
      .replace(/\d(?=(\d{3})+\,)/g, "$&.");
  }

